import React, { Component } from 'react';


class NavBar extends Component {
    state = {  }
    styles={
        textAlign: 'center'
    }
    render() { 
        return ( 
            <div>
                <nav className="navbar navbar-default">
                    <div className="container-fluid" >
                        <div className="navbar-header navbar-brand " style={this.styles}>
                        <h1>To-Do
                            <span class="badge m-2 badge-primary m-2"></span>
                        </h1>
                        </div>
                    </div>
                </nav>
            </div>
         );
    }
}
 
export default NavBar;
